script: |
  super -f text -I q11454.spq | sort > q11454.out

inputs:
  - name: q11454.spq
    data: |
      SELECT DISTINCT - col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( + col1, + 11 - - col2 + - col2 + - - 40, + col2 ) OR NOT - col1 IS NULL;
  - name: tab1

outputs:
  - name: q11454.out
    data: |
      -59
      -68
      -96
